import {
    Box,
    Text,
    Flex,
    Accordion,
    Center,
    Avatar,
    Badge,
    Checkbox,
    Grid
  } from "@mantine/core";
import React from 'react'
import ResponsivePhone from '../ResponsivePhone'

const Index = () => {
  return (
    <Grid mt="xs" pb="xs">
        <Grid.Col span={4}>1</Grid.Col>
        <Grid.Col span={4}><ResponsivePhone /></Grid.Col>
        <Grid.Col span={4}>3</Grid.Col>
    </Grid>
  )
}

export default Index
